Actionscript.script:
parent.$mc_ctrler.setBishaSUPER();
parent.$mc_ctrler.setBishaUP();
parent.$mc_ctrler.setSkill2("砍技2_QK");
parent.$mc_ctrler.setZhao3();
parent.$mc_ctrler.setZhao1();
parent.$mc_ctrler.setAttack("砍4");

//执行移动
parent.$mc_ctrler.movePercent(1.2,-1.5); //参数为X,Y
parent.$mc_ctrler.dampingPercent(0.05,0.05); //移动阻尼，参数为X,Y

parent.$mc_ctrler.movePercent(1,-1); //参数为X,Y
parent.$mc_ctrler.dampingPercent(0.05,0.05); //移动阻尼，参数为X,Y
parent.$mc_ctrler.isApplyG(true);

if(parent.$fighter_ctrler.justHit("bs")){
	var mc = parent.$mc_ctrler.getAttacker("bsmc");
	if(mc){
		mc.gotoAndPlay("double_hit");
	}else{
		parent.$mc_ctrler.addAttacker("bsmc",{x:{followTarget:true,offset:0},y:{followTarget:true,offset:-20},applyG:false});
	}
	parent.$effect_ctrler.shine(0xFF0000);
}
